pragma solidity ^0.4.23;

import 'zeppelin-solidity/contracts/ownership/Ownable.sol';
import './DatasetToken.sol';

contract Factory is Ownable {

  address[] public datasets;

  function createDataset(string name, string symbol, uint8 decimals, uint32 requestGoal) onlyOwner public {
    Dataset ds = new Dataset(name, symbol, decimals, requestGoal);
    datasets.push(ds);
  }

  function getDatasets() public view returns (address[]) {
    return datasets;
  }
}
